import React from 'react';

import { Container, Logo } from './styles';

export default function Home() {
  function login() {}

  return (
    <Container>
      <Logo>
        <span>Live</span>
        <div />
      </Logo>
      <button type="button" to="/live">
        Entrar
      </button>
    </Container>
  );
}
